We begin with two useful methods in a trait declaration: trait Hierarchy { // Removes the child status of an entity. fn detach(&mut self, id: EntityId); // Attaches an entity as a child to a given parent entity. fn attach(&mut self, id: EntityId, parent: EntityId);
} With these, you'll be able to not only insert new entities into the tree but also move a whole subtree – a child with all its descendants – to another parent. Since we need access to EntitiesViewMut as well as our hierarchy component storages, we implement the Hierarchy trait for the type (EntitiesViewMut<'_>, ViewMut<'_, Parent>, ViewMut<'_, Child>). fn detach(&mut self, id: EntityId) { let (_, parents, children) = self; // remove the Child component - if nonexistent, do nothing if let Some(child) = children.remove(id) { // retrieve and update Parent component from ancestor let parent = &mut parents[child.parent]; parent.num_children -= 1; if parent.num_children == 0 { // if the number of children is zero, the Parent component must be removed parents.remove(child.parent); } else { // the ancestor still has children, and we have to change some linking // check if we have to change first_child if parent.first_child == id { parent.first_child = child.next; } // remove the detached child from the sibling chain children[child.prev].next = child.next; children[child.next].prev = child.prev; } }
} Before we move on to attach, let's make some observations. We use indexing on parents and children but if the entity doesn't have the component it'll unwrap. We don't have to worry as long as we only use the methods in our Hierarchy trait. If you accidentally delete hierarchy components in other places without changing the linking, things will go fatally wrong. If you want to catch these errors you might want to use get and handle the error (for example with expect). attach looks like this: fn attach(&mut self, id: EntityId, parent: EntityId) { // the entity we want to attach might already be attached to another parent self.detach(id); let (entities, parents, children) = self; // either the designated parent already has a Parent component – and thus one or more children if let Ok(p) = parents.get(parent) { // increase the parent's children counter p.num_children += 1; // get the ids of the new previous and next siblings of our new child let prev = children[p.first_child].prev; let next = p.first_child; // change the linking children[prev].next = id; children[next].prev = id; // add the Child component to the new entity entities.add_component(id, children, Child { parent, prev, next }); } else { // in this case our designated parent is missing a Parent component // we don't need to change any links, just insert both components entities.add_component( id, children, Child { parent, prev: id, next: id, }, ); entities.add_component( parent, parents, Parent { num_children: 1, first_child: id, }, ); }
} We can now add another handy method to our trait: // Creates a new entity and attaches it to the given parent.
