There are different ways the hierarchy can be queried. For example, we may want to know the parent of a given entity. Doing this is simply done by inspecting its child component - if there is one. However, sometimes you might need all children, all ancestors, or all descendants of a given entity. A perfect use case for iterators! An iterator has to implement the next method from the Iterator trait. We start with a ChildrenIter, which is pretty straightforward: struct ChildrenIter<C> { get_child: C, cursor: (EntityId, usize),
} impl<'a, C> Iterator for ChildrenIter<C>
where C: Get<Out = &'a Child> + Copy,
{ type Item = EntityId; fn next(&mut self) -> Option<Self::Item> { if self.cursor.1 > 0 { self.cursor.1 -= 1; let ret = self.cursor.0; self.cursor.0 = self.get_child.get(self.cursor.0).unwrap().next; Some(ret) } else { None } }
} Note that we don't implement Iterator for ViewMut<Child> directly, but for a type that implements the GetComponent trait. This way, our iterator can be used with View as well as ViewMut. The next one is the AncestorIter: struct AncestorIter<C> { get_child: C, cursor: EntityId,
} impl<'a, C> Iterator for AncestorIter<C>
where C: Get<Out = &'a Child> + Copy,
{ type Item = EntityId; fn next(&mut self) -> Option<Self::Item> { self.get_child.get(self.cursor).ok().map(|child| { self.cursor = child.parent; child.parent }) }
} Easy. DescendantIter will be a bit more complicated. We choose to implement a depth-first variant using recursion. It is based on the code for the ChildrenIter but comes with an additional stack to keep track of the current level the cursor is in: Push a new level to the stack if we encounter a Parent component. Pop the last level from the stack whenever we run out of siblings, then carry on where we left off. struct DescendantsIter<P, C> { get_parent: P, get_child: C, cursors: Vec<(EntityId, usize)>,
} impl<'a, P, C> Iterator for DescendantsIter<P, C>
where P: Get<Out = &'a Parent> + Copy, C: Get<Out = &'a Child> + Copy,
{ type Item = EntityId; fn next(&mut self) -> Option<Self::Item> { if let Some(cursor) = self.cursors.last_mut() { if cursor.1 > 0 { cursor.1 -= 1; let ret = cursor.0; cursor.0 = self.get_child.get(cursor.0).unwrap().next; if let Ok(parent) = self.get_parent.get(ret) { self.cursors.push((parent.first_child, parent.num_children)); } Some(ret) } else { self.cursors.pop(); self.next() } } else { None } }
} What we still need to do is to implement a simple trait with methods that return nicely initialized *Iter structs for us: trait HierarchyIter<'a, P, C> { fn ancestors(&self, id: EntityId) -> AncestorIter<C>; fn children(&self, id: EntityId) -> ChildrenIter<C>; fn descendants(&self, id: EntityId) -> DescendantsIter<P, C>;
} impl<'a, P, C> HierarchyIter<'a, P, C> for (P, C)
where P: Get<Out = &'a Parent> + Copy, C: Get<Out = &'a Child> + Copy,
{ fn ancestors(&self, id: EntityId) -> AncestorIter<C> { let (_, children) = self; AncestorIter { get_child: *children, cursor: id, } } fn children(&self, id: EntityId) -> ChildrenIter<C> { let (parents, children) = self; ChildrenIter { get_child: *children, cursor: parents .get(id) .map_or((id, 0), |parent| (parent.first_child, parent.num_children)), } } fn descendants(&self, id: EntityId) -> DescendantsIter<P, C> { let (parents, children) = self; DescendantsIter { get_parent: *parents, get_child: *children, cursors: parents.get(id).map_or_else( |_| Vec::new(), |parent| vec![(parent.first_child, parent.num_children)], ), } }
} Cool. Let's extend the former usage example into a little test. #[test]
