The order between siblings may or may not play a role in your project. However, a simple sorting for children can be done in two steps: Collect all children into a Vec and sort it. Adjust the linking in the Child components according to the sorted list. We can add this method to the Hierarchy trait: fn sort_children_by<F>(&mut self, id: EntityId, compare: F)
where F: FnMut(&EntityId, &EntityId) -> std::cmp::Ordering,
{ let (_, parents, children_storage) = self; let mut children = (&*parents, &*children_storage) .children(id) .collect::<Vec<EntityId>>(); if children.len() > 1 { children.sort_by(compare); // set first_child in Parent component parents[id].first_child = children[0]; // loop through children and relink them for i in 0..children.len() - 1 { children_storage[children[i]].next = children[i + 1]; children_storage[children[i + 1]].prev = children[i]; } children_storage[children[0]].prev = *children.last().unwrap(); children_storage[*children.last().unwrap()].next = children[0]; }
